let chartOpts = {},
    myChart;
async function drawCharts(items){
    let options = {
        chart: {
            type: 'line',
            height: 'auto',
            width: "100%",
            background: '#fff',
            toolbar: {
                show: false,
                tools: {
                    download: true,
                    selection: true,
                    zoom: true,
                    zoomin: true,
                    zoomout: true,
                    pan: true,
                    reset: true
                },
            },
            animations: {
                enabled: false,
                easing: 'easeout'
            }
        },
        tooltip:{
            x:{
                show: true,
                format:'dd/MM/yyyy - H:mm'
            },
            y:{
            },
            marker: {
                show: false,
            },
            fixed: {
                enabled: false,
                position: 'topRight',
                offsetX: 0,
                offsetY: 0,
            },
            onDatasetHover: {
                highlightDataSeries: false,
            },
        },
        stroke: {
            show: true,
            curve: 'smooth',
            lineCap: 'round',
            colors: ['#2FA6FA'],
            width: 3,
            dashArray: 0
        },
        series: [
            {
                name:'',
                data: items
            }
        ],
        xaxis: {
            type:"datetime",
            tooltip: {
                enabled: false,
            },
        },
        responsive: [
            {breakpoint: 2000,
                options: {
                    chart: {
                        height: 'auto',
                        width:'100%',
                    }
                },
            },
            {breakpoint: 1290,
                options: {
                    chart: {
                        height: '250px',
                        width:'100%',
                    }
                },
            },
            {breakpoint: 900,
                options: {
                    chart: {
                        height:'200px'
                    }
                },
            },
        ],
        grid: {
            show: true,
            borderColor:'#fff'
        }
    };
    myChart = new ApexCharts(document.querySelector("#chart"), options);
    myChart.render();
    setAnimation();
    animateFirst();
}
function updateCharts(items) {
    myChart.updateSeries([{
        data: items
    }], true)
}
async function renderCharts() {
    let timePoints = chartOpts.timePoints || 168,
        currency = chartOpts.currency || `USD`,
        ticker = chartOpts.coin || `BTC`,
        chartRange = chartOpts.chartRange || 'histohour',
        items = [];
    let result = await fetch(`https://min-api.cryptocompare.com/data/${chartRange}?fsym=${ticker}&tsym=${currency}&limit=${timePoints}`),
        dataJson = await result.json(),
        arr = dataJson.Data;
    let i = 0;
    console.log(arr.length)
    arr.forEach(function(val){
        let time = val.time + '000',
            itemInfo = [];
        itemInfo.push(+time, val.close);
        if ( !(i % Math.floor(arr.length / 25)) ) {
            console.log(i % Math.floor(arr.length / 25))
            items.push(itemInfo);
        }
        i++
    });
    console.log(items.length)
    if (chartOpts.firstTime) {
        return drawCharts(items);
    } else {
        return updateCharts(items);
    }
}
document.addEventListener("DOMContentLoaded", function () {
    chartOpts = {
        currency: (document.querySelector('.coin-head').getAttribute('data-currency') || 'USD').toUpperCase(),
        coin: document.querySelector('.coin-head').getAttribute('data-coin') || 'BTC',
        timePoints: 168,
        symbol: '$',
        firstTime: true
    };
    switch (chartOpts.currency) {
        case 'USD':
            chartOpts.symbol = '$';
            break;
        case 'RUB':
            chartOpts.symbol = '';
            break;
        default:
            chartOpts.symbol = '$';
    }
    chartOpts.symbol += ' ';
    renderCharts();
    document.querySelectorAll('.chart__range').forEach(function(item){
        item.addEventListener('click', triggerUpdate)
    })
    document.querySelector('.chart__right--select').addEventListener('change', triggerUpdate)
});
async function triggerUpdate() {
    let that = this;
    let buttonType;
    if ( that.classList.contains('chart__right--select') ) {
        buttonType = that.value;
    } else {
        buttonType = that.getAttribute('data-chart');
    }
    let path   = document.querySelector('.apexcharts-series path');
    path.style = '';
    chartOpts.firstTime = false;
    switch (buttonType) {
        case '1h':
            chartOpts.chartRange = 'histominute';
            chartOpts.timePoints = '60';
            chartOpts.currentSelector = '1h';
            break;
        case '6h':
            chartOpts.chartRange = 'histominute';
            chartOpts.timePoints = '360';
            chartOpts.currentSelector = '6h';
            break;
        case 'day':
            chartOpts.chartRange = 'histominute';
            chartOpts.timePoints = '1440';
            chartOpts.currentSelector = 'day';
            break;
        case 'week':
            chartOpts.chartRange = 'histohour';
            chartOpts.timePoints = '168';
            chartOpts.currentSelector = 'week';
            break;
        case 'month':
            chartOpts.chartRange = 'histoday';
            chartOpts.timePoints = '30';
            chartOpts.currentSelector = 'month';
            break;
        case 'year':
            chartOpts.chartRange = 'histoday';
            chartOpts.timePoints = '365';
            chartOpts.currentSelector = 'year';
            break;
        default:
            chartOpts.chartRange = 'histohour';
            chartOpts.timePoints = '168';
            chartOpts.currentSelector = '1h';
    }
    document.querySelectorAll('[data-chart]').forEach(function(item) {
            item.classList.remove('active');
    });
    document.querySelector('[data-chart="' + chartOpts.currentSelector + '"]').classList.add('active');
    renderCharts()
}
async function setAnimation() {
    myChart.updateOptions({
        chart: {
            animations: {
                enabled: true,
            }
        }
    })
}
async function animateFirst() {
    let path   = document.querySelector('.apexcharts-series path'),
        length = path.getTotalLength().toFixed(),
        chart  = document.querySelector('.chart');
    path.style = `stroke-dasharray: ${length};
                  stroke-dashoffset: ${length};`;
    setTimeout(function() {
        chart.classList.add('loaded');
    },50)
}
let coins = document.querySelector('.coins').getAttribute('data-coins');
let url = `https://owl.atomicwallet.io/assetData?fiat=USD&tickers=${coins}`;
let listCoins = [];
document.addEventListener("DOMContentLoaded", renderSidebar);
function renderSidebar() {
    fetch(url).then((response) => {
        return response.json();
    }).then((dataJson) => {
        listCoins = dataJson;
        renderList();
    })
}
function renderList() {
    let check = document.getElementById('check_prediction').value,
        container = document.querySelector('.coins'),
        item = '',
        url = '',
        nameCrypto = '',
        keyData;
    for (let key in listCoins) {
        keyData = listCoins[key];
        item = `<a href="#" class="coins__item" id="link-${key.toLowerCase()}">
                    <div class="coins__left">
                        <i class="icon icon-${key.toLowerCase()}"></i>
                        <div class="coins__name">
                            <span class="coins__full name-crypto-${key.toLowerCase()}"></span>
                            <span class="coins__short">${key}</span>
                        </div>
                    </div>
                    <div class="coins__price">$${keyData.PRICE}</div>
                 </a>`;
        jQuery(container).append(item);
        nameCrypto = window.getComputedStyle(document.querySelector(".name-crypto-" + key.toLowerCase()), ':before').content;
        nameCrypto = (nameCrypto.replace(/['"]+/g, '')).toLowerCase();
        nameCrypto = nameCrypto.replace(' ', '-');
        !!Number.parseInt(check) ? url = nameCrypto + '-price-' + 'prediction' : url = nameCrypto + '-price';
        let link = document.getElementById('link-' + key.toLowerCase());
        link.setAttribute('href', url);
        item = '';
    }
}
function getCurrency() {
    let currency = (document.querySelector('#chart').getAttribute('data-currency') || 'USD').toUpperCase();
    switch (currency) {
        case 'USD':
            chartOpts.symbol = '$';
            break;
        case 'RUB':
            chartOpts.symbol = '';
            break;
        default:
            chartOpts.symbol = '$';
    }
    chartOpts.symbol += ' ';
}
document.addEventListener("DOMContentLoaded", getCoin);
function getCoin() {
    let coin = document.querySelector('.coin-head').getAttribute('data-coin').toUpperCase();
    let url = `https://min-api.cryptocompare.com/data/pricemultifull?fsyms=${coin}&tsyms=USD`;
    fetch(url).then((response) => {
        return response.json();
    }).then((dataJson) => {
        data = dataJson;
        renderHead(data, coin);
    })
}
async function renderHead(data, key) {
    let icon      = document.querySelector('.coin-head__icon'),
        price     = document.querySelector('.chart__price'),
        deltaPerc = document.querySelector('.chart__delta'),
        cap       = document.querySelector('[data-chart="cap"]'),
        volume    = document.querySelector('[data-chart="volume"]'),
        supply    = document.querySelector('[data-chart="supply"]'),
        high      = document.querySelector('[data-chart="high"]');
    icon.classList.add(`icon-${key.toLowerCase()}`);
    deltaPerc.innerText = `${data.DISPLAY[key].USD.CHANGEPCTDAY}%`;
    price.innerHTML     = data.DISPLAY[key].USD.PRICE.replace(' ', '');
    cap.innerHTML       = data.DISPLAY[key].USD.MKTCAP.replace(' ', '');
    volume.innerHTML    = data.DISPLAY[key].USD.TOTALVOLUME24HTO.replace(' ', '');
    high.innerHTML      =  data.DISPLAY[key].USD.HIGH24HOUR.replace(/(\.\d{1,2})\d*$/, '$1').replace(' ', '');
    if ( !(data.DISPLAY[key].USD.CHANGEPCTDAY.indexOf('-') + 1) ) deltaPerc.classList.add('up');
    let reg = /,/g,
        supplyParts = data.DISPLAY[key].USD.SUPPLY.split(' '),
        supplySum   = Number.parseInt(supplyParts[1].replace(reg, '')),
        supplyLen   = (supplySum + '').length,
        postSym;
    if (supplyLen < 8) {
        postSym   = '';
    } else if (supplyLen < 11) {
        supplySum = supplySum / 1000000;
        postSym   = 'M';
    } else if (supplyLen < 14) {
        supplySum = supplySum / 1000000000;
        postSym   = 'B';
    }
    supplySum = supplySum.toFixed(1);
    supply.innerHTML = `${supplySum}${postSym} ${key}`;
}
document.addEventListener('DOMContentLoaded', function () {
    let popLinks = document.querySelector('.subs-pop--links');
    if (popLinks) {
        document.body.appendChild(popLinks);
    }
    if (document.querySelector('.wrap-blue')) {
        function moveLeft() {
            let wrapBlue = document.querySelector('.wrap-blue'),
                coverBlue = document.querySelector('.wrap-blue__cover'),
                wrapOffsetOrigin = document.querySelector('.main__wrapper');
            coverBlue.style.left = '-' + (wrapOffsetOrigin.offsetLeft + wrapOffsetOrigin.parentNode.offsetLeft) + 'px';
            coverBlue.style.width = document.querySelector('html').clientWidth + 'px';
        }
        moveLeft();
        window.addEventListener('resize', moveLeft)
    }
    var replyForm = document.querySelector('.messages__form');
